import {Link} from "react-router-dom";
import React from "react";

const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>Мое Портфолио</h1>
            <ul>
                <li><Link to="/">Главная</Link></li>
                <li><Link to="/project1">Проект 1</Link></li>
                <li><Link to="/project2">Проект 2</Link></li>
                <li><Link to="/project3">Проект 3</Link></li>
            </ul>
        </nav>
    );
};


export default Navbar;
